import { Card, CardContent, Container, CardHeader } from "@mui/material";
import "./styles.css";

const styles = {
  container: {
    component: "div",
  },
  card: {
    component: "div",
    variant: "outlined",
    maxWidth: "sm",
  },
  cardHeader: {
    titleTypographyProps: {
      variant: "h4",
      component: "h4",
      align: "center",
      gutterBottom: true,
      // gutterTop: true,
    },
    subheaderTypographyProps: {
      variant: "h6",
      component: "h6",
      align: "center",
    },
  },
};

function Shell({ heading, content, subheading }) {
  return (
    <Container {...styles.container}>
      <Card {...styles.card}>
        <CardHeader
          {...styles.cardHeader}
          title={heading}
          subheader={subheading}
        ></CardHeader>
        <CardContent>{content}</CardContent>
      </Card>
    </Container>
  );
}

export default Shell;
